SELECT DISTINCT 'INSERT INTO REGIAO (REGIAO_CODIGO, REGIAO, ID_COMARCA, CODIGO_TEMP) VALUES (' || TO_NUMBER(TRIM((T1.CODIGO || TRIM(TO_CHAR(T6.COMARCA_CODIGO, '000'))))) || ',''' || T1.DESCRICAO || ''',' || T6.ID_COMARCA || ',' || T1.CODIGO || ');'
FROM REGIAO_SPG T1 INNER JOIN ZONA_BAIRRO_SPG T2 ON T2.REGIAO_CIVEL = T1.CODIGO
INNER JOIN BAIRRO T3 ON T3.CODIGO_SPG = TO_NUMBER(TRIM(TRIM(TO_CHAR(CODIGO_MUNICIPIO, '0000000')) || TRIM(TO_CHAR(CODIGO_BAIRRO,'00000'))))
INNER JOIN CIDADE T4 ON T3.ID_CIDADE = T4.ID_CIDADE
INNER JOIN COMARCA_CIDADE T5 ON T4.ID_CIDADE = T5.ID_CIDADE
INNER JOIN COMARCA T6 ON T5.ID_COMARCA = T6.ID_COMARCA


--Gerar inserts para a tabela REGIÃO que NÃO possuem região cadastrada no SPG
SELECT DISTINCT 'INSERT INTO REGIAO (REGIAO_CODIGO, REGIAO, ID_COMARCA, CODIGO_TEMP) VALUES (' || TO_NUMBER(TRIM(TO_CHAR(T6.COMARCA_CODIGO, '000'))) || ',''' || 'REGIAO I - VARIAS ZONAS' || ''',' || T6.ID_COMARCA || ',0);'
FROM ZONA_BAIRRO_SPG T2
INNER JOIN BAIRRO T3 ON T3.CODIGO_SPG = TO_NUMBER(TRIM(TRIM(TO_CHAR(CODIGO_MUNICIPIO, '0000000')) || TRIM(TO_CHAR(CODIGO_BAIRRO,'00000'))))
INNER JOIN CIDADE T4 ON T3.ID_CIDADE = T4.ID_CIDADE
INNER JOIN COMARCA_CIDADE T5 ON T4.ID_CIDADE = T5.ID_CIDADE
INNER JOIN COMARCA T6 ON T5.ID_COMARCA = T6.ID_COMARCA
WHERE T2.ZONA_CIVEL > 0
AND T2.REGIAO_CIVEL = 0
AND NOT EXISTS (SELECT 1 FROM ZONA_BAIRRO_SPG T7 WHERE T2.CODIGO_MUNICIPIO = T7.CODIGO_MUNICIPIO AND T7.REGIAO_CIVEL > 0)


