--Ajustes do relacionamento entre cidades e comarcaS de acordo com o SPG
SELECT 'INSERT INTO COMARCA_CIDADE (ID_COMARCA, ID_CIDADE) VALUES (' || C.ID_COMARCA || ',' || CD.ID_CIDADE || ');'
FROM COMARCA C JOIN CIDADE_COMARCA_SPG CCS ON CCS.COMARCA = C.COMARCA_CODIGO
JOIN CIDADE CD ON CD.CODIGO_SPG = CCS.CODIGO
WHERE NOT EXISTS (SELECT 1 FROM COMARCA_CIDADE CC WHERE CC.ID_CIDADE = CD.ID_CIDADE)


--Gerar inserts para a tabela ZONA_BAIRRO_REGIAO que possuem região cadastrada no SPG
SELECT DISTINCT 'INSERT INTO ZONA_BAIRRO_REGIAO (ID_ZONA, ID_BAIRRO, ID_REGIAO) VALUES (' || ID_ZONA || ',' || ID_BAIRRO || ',' || ID_REGIAO || ');'
FROM ZONA_BAIRRO_SPG T2
INNER JOIN BAIRRO T3 ON T3.CODIGO_SPG = TO_NUMBER(TRIM(TRIM(TO_CHAR(CODIGO_MUNICIPIO, '0000000')) || TRIM(TO_CHAR(CODIGO_BAIRRO,'00000'))))
INNER JOIN CIDADE T4 ON T3.ID_CIDADE = T4.ID_CIDADE
INNER JOIN COMARCA_CIDADE T5 ON T4.ID_CIDADE = T5.ID_CIDADE
INNER JOIN COMARCA T6 ON T5.ID_COMARCA = T6.ID_COMARCA
INNER JOIN REGIAO T7 ON T7.ID_COMARCA = T6.ID_COMARCA
INNER JOIN ZONA T8 ON T8.ZONA_CODIGO = T2.ZONA_CIVEL AND T8.ID_COMARCA = T7.ID_COMARCA 
WHERE T2.REGIAO_CIVEL = T7.CODIGO_TEMP
AND T2.REGIAO_CIVEL > 0


