INNER JOIN REGIAO T7 ON T7.ID_COMARCA = T6.ID_COMARCA
INNER JOIN ZONA T8 ON T8.ZONA_CODIGO = T2.ZONA_CIVEL AND T8.ID_COMARCA = T7.ID_COMARCA 
